(3, 'testing 1', 'testing-1', '<div>Menjelang perayaan Natal dan Tahun Baru 2025, berbagai persiapan mulai dilakukan di seluruh Indonesia. Kota-kota besar seperti Jakarta, Surabaya, dan Bandung telah menghias jalan-jalan dengan lampu warna-warni dan dekorasi khas. Pusat perbelanjaan menawarkan diskon menarik untuk menarik pengunjung. Selain itu, berbagai acara budaya dan festival musik direncanakan untuk merayakan momen spesial ini. Masyarakat juga diimbau untuk menjaga keamanan dan ketertiban selama perayaan. Di sisi lain, sektor pariwisata diharapkan mengalami lonjakan kunjungan, dengan banyak wisatawan domestik dan mancanegara yang ingin merasakan suasana Nataru di Indonesia. Semoga perayaan ini membawa kebahagiaan dan kedamaian bagi semua.</div>', '[\"data:image\\/jpeg;base64,\\/9j\\/4AAQSkZJRgABAQAAAQABAAD\\\\/WRldNNlR2XBdkHWyGdVZ+jYgskjacq6eMstu+mcrH12Xkd\\/H5\\/\\/\\/\\/2wBDAAICAgICAgMCAgMEAwMDBAUEBAQEBQcFBQUFBQcIBwcHBwcHCAgICAgICAgKCgoKCgoLCwsLCw0NDQ0NDQ0NDQ3\\/2wBDAQICAgMDAwYDAwYNCQcJDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ0NDQ3\\/wgARCAQ4BDgDASIAAhEBAxEB\\/8QAHgABAAAGAwEAAAAAAAAAAAAAAAgHCQEGBQIEAwr\\/2gAIAQEAAAAAnl88v3Odg09NvzqfcgAAAAAAAAAAAAAAAAAAAA+duFf6zCUHyWQ94z9UlTgAAAAAAAAAAAAAAAAAAAAPnXkr9STU\\/HZnn1C\\/GD9F9XcAAAAAAAAAAAAAAAAAAAAKSXzqfbJmlKP5lvtr+b6Cf7Q8wAAAAAAAAAAAAAAAAAAAADF\\/i0n99FVI2npNGFT67ItgAAAAAAAAAAAAAAAAAAAAIbvmYp\\/cNjVN+iueYAAAAAAAAAAAAAAAAAAAAAlLT5+X77YYgAQ\\/ZrMwAAAAAAAAAAAAAAAAAAAAPkUwX66c8D5ad59PQAAAAAAAAAAAAAAAAAAAASh+RDY\\/VnESKZHyx\\/cXMgAAAAAAAAAAAAAAAAAAAAJb\\/LlAhXqrZZQ6HxI1s65QAAAtda6wva6y9rllwLLrXsva4tcBa6wva5a4AAAAADwo\\/wDz59Gs\\/WMntQeo6fbF2gAA811hda93G173cV1hdYXFnJa9ll1ly1xxuX48lnolVNWHafUsMpzUAAAABi1IWi1CxUJqVfOf9aNRsOMI2w3Eu4hqTVbYcIbur0JQzrwHGpyGllI5TUyDzkbybKcJK\\/GW4m9e0qU1pZ9uYK0jLu\\/OQlfvMukpODZWdaSuWTHLYRgc88TwucVuMTvo+UmNapH4S7nRkEQAAAAABxgnpE0mZc1bPqQEvodIoqadRall8\\/0Vn1xDzgp1sNlAeuxRzmnWimUgtok2VKqsGE\\/NR6M0roxBvn9h5tmNfecF\\/nplXXcpcedYKa+g+ZD2b6vREE+eacFTz586r9SohEoZT+rHT8KRdOqrtoKb